css:
.git-control .dialog {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  min-width: 50%;
  background: #161719;
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 4px;
  padding: 15px;
  opacity: 0.95;
  display: none;
  z-index: 10;
}
.git-control .dialog.active {
  display: block;
}
.git-control .dialog .body {
  margin-bottom: 15px;
}
.git-control .dialog .heading {
  margin-bottom: 15px;
}
.git-control .dialog .heading strong {
  color: #ffffff;
  display: inline-block;
}
.git-control .dialog .heading i.icon {
  float: right;
  width: 0;
  margin-right: 15px;
}
.git-control .dialog input,
.git-control .dialog select,
.git-control .dialog textarea {
  width: 100%;
  margin-bottom: 15px;
  background: #212224;
  border-color: rgba(0, 0, 0, 0.5);
  border-radius: 4px;
  color: #aaaaaa;
  padding: 10px;
}
.git-control .dialog .checkbox {
  width: 5%;
  display: inline;
  vertical-align: -30%;
}
.git-control .dialog input[readonly],
.git-control .dialog textarea[readonly],
.git-control .dialog select[readonly] {
  color: #555555;
}
.git-control .dialog select {
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
}
.git-control .dialog textarea {
  height: 150px;
  resize: none;
}
.git-control .dialog textarea.over-fifty {
  color: #cc0000;
}
.git-control .dialog .warningText {
  color: #ff982d;
}
.git-control .dialog .warningText:hover {
  color: #cc0000;
}
.git-control .dialog button {
  background: transparent;
  border: 1px solid transparent;
  border-radius: 4px;
  color: #aaaaaa;
  margin-right: 10px;
}
.git-control .dialog button:hover {
  color: #ffffff;
}
